   287→        <h1 id="firstHeading">Edinburgh Institute for Temporal Studies</h1>
   288→        <div id="siteSub">From Wikipedia, the free encyclopedia</div>
   289→        <div id="contentSub"><i>Not to be confused with the <a href="/wiki/Royal_Observatory,_Edinburgh">Royal Observatory, Edinburgh</a> or the <a href="/wiki/Edinburgh_Time_Ball">Edinburgh Time Ball</a>.</i></div>
